import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    view: {
        backgroundColor: 'black',
        display: 'flex',
        height: '100%',
        alignItems: 'center'
    },
    text: {
        backgroundColor: 'white',
        width: '50%',
        height: '10%',
        margin: 20,
        borderRadius: 20,
        justifyContent: 'center'
    }
})
